import React from 'react';
import AboutMeImg from '../../assets/images/aboutMeImg';

function About() {
    return (
        <section>
            <div className="center" id="about">
                <h1>About Me</h1>
            </div>
            <div className="center">
                <img
                   src={AboutMeImg}
                   alt="about-me"
                   className="photo" 
                />
            </div>
        </section> 
    )
}

export default About;
